import { IonCol, IonContent, IonGrid, IonPage, IonRow, IonSegment, IonSegmentButton, IonSlide, IonSlides, IonToolbar } from '@ionic/react';
import React from 'react';

import "../css/Global.css";
import "../css/CampusFacilitiesMap.css";

import TopNav from '../components/TopNav';
import Menu from '../components/Menu';

const CampusFacilitiesMap: React.FC = () => {

    const slideOpts = {
        initialSlide: 1,
        speed: 400
      };

    return (
        <IonPage>
            <TopNav title="Campus Facilities Map" route='/u/home' backarrow={ true } hamburger = { true }/>
            
            <IonContent fullscreen={true} className="campusFacilMapIonContent">
                <IonGrid className="campusFacilGrid">
                    <IonRow id="campusMapImg">
                        {/* <IonCol className="gmap_canvas">
                          
                                <iframe width="100%" height="50%" id="gmap_canvas" src="https://maps.google.com/maps?q=singapore%20institute%20of%20management&t=k&z=17&ie=UTF8&iwloc=&output=embed" frameBorder="0" scrolling="no" marginHeight={0} marginWidth={0}></iframe>
                          
                        </IonCol> */}
                        <div style={{width: "100%"}}>
                            <iframe width="100%" height="500" frameBorder="0" scrolling="no" marginHeight={0} marginWidth={0} src="https://maps.google.com/maps?width=100%25&amp;height=500&amp;hl=en&amp;q=461%20Clementi%20Rd,%20Singapore%20599491+(Singapore%20Institute%20of%20Management)&amp;t=k&amp;z=18&amp;ie=UTF8&amp;iwloc=B&amp;output=embed"></iframe>
                        </div>
                    </IonRow>

                    <IonRow>
                        <IonSlides pager={true} options={slideOpts}>
                            <IonSlide>
                                <h1>Slide 1</h1>
                            </IonSlide>
                            <IonSlide>
                                <h1>Slide 2</h1>
                            </IonSlide>
                            <IonSlide>
                                <h1>Slide 3</h1>
                            </IonSlide>
                        </IonSlides>
                    </IonRow>
                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default CampusFacilitiesMap;
